import Auth from "./pages/Auth";

export const authRoutes = [
    {
        patch: ADMIN_ROUTER,
        Component: A
    },
    {
        patch: BASKET_ROUTER,
        Component: Basket
    }
]

export const publicRoutes = [
    {
        patch: LOGIN_ROUTER,
        Component: Auth
    },
    {
        patch: REGISTRATION_ROUTER,
        Component: Auth
    }
]
